import React, { useEffect, useState } from 'react';

function App() {
  const [portfolio, setPortfolio] = useState([]);

  useEffect(() => {
    // Make sure to replace 'http://localhost:5000' with the actual backend URL if different
    fetch('127.0.0.1:5000/')
      .then((response) => response.json())
      .then((data) => setPortfolio(data.portfolios))
      .catch((error) => console.log(error));
  }, []);

  return (
    <div>
      {portfolio.map((item, index) => (
        <div key={index}>
          {item.symbol}: Profit/Loss - {item.profitLoss}
        </div>
      ))}
    </div>
  );
}

export default App;
